import React from "react";
import { AppBar, Drawer } from "@material-ui/core";

const paperstyle = {
  height: "85%",
  width: "85%",
  margin: "7%",
  textAlign: "center",
  display: "inline-block",
};

function SideBar() {

  return (
    <div>
      <AppBar></AppBar>
      <Drawer></Drawer>
    </div>
  );
}

export default SideBar;
